// src/App.js
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Importing necessary components
import Login from "./pages/Login"; // Adjust the path to your actual file structure
import Home from "./pages/Home";
import Register from "./pages/Register";
import ChangePassword from "./pages/ChangePassword";
import Product from "./pages/product";
import AddProduct from "./pages/addproduct";
import AdminDashboard from "./components/AdminDashboard";
import UserDashboard from "./components/UserDashoard";





function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
        <Route path="/" element={<Home />} />
          <Route path="/Login" element={<Login />} />
          <Route path="register" element={<Register />} />
          <Route path="/Product" element={<Product/>}/>
          <Route path="/addproduct" element={<AddProduct/>}/>
          <Route path="/ChangePassword" element={<ChangePassword />} />
          <Route path="/admin/dashboard" element={<AdminDashboard/>}/>
          <Route path="/user/dashboard" element={<UserDashboard />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
